void initItemInfo(void){
	int variety,number,y,x;
	int flag;
	for(variety=0;variety<ITEM_VARIETY;variety++){
		/* 右向きの設定 */
		for(number=0;number<ITEM_NUMBER;number++){
			initInfoI[0][variety][number].existStartY=
			initInfoI[0][variety][number].existStartX=
			initInfoI[0][variety][number].existEndY=
			initInfoI[0][variety][number].existEndX=
			initInfoI[0][variety][number].crashStartY=
			initInfoI[0][variety][number].crashStartX=
			initInfoI[0][variety][number].crashEndY=
			initInfoI[0][variety][number].crashEndX=0;
			/* existStartY,Xの探索 */
			for(y=0,flag=FALSE;y<OBJECT_LINES;y++){
				for(x=0;x<OBJECT_COLS;x++){
					if(getColorInfo(itemInfo[variety][number][y][x])<64){
						initInfoI[0][variety][number].existStartY=y;
						initInfoI[0][variety][number].existStartX=x;
						flag=TRUE;
						break;
					}
				}
				if(flag==TRUE)
				break;
			}
			/* existEndY,Xの探索 */
			for(y=OBJECT_LINES-1,flag=FALSE;y>=0;y--){
				for(x=OBJECT_COLS-1;x>=0;x--){
					if(getColorInfo(itemInfo[variety][number][y][x])<64){
						initInfoI[0][variety][number].existEndY=y;
						initInfoI[0][variety][number].existEndX=x;
						flag=TRUE;
						break;
					}
				}
				if(flag==TRUE)
					break;
			}
			/* crashStartY,Xの探索 */
			for(y=0,flag=FALSE;y<OBJECT_LINES;y++){
				for(x=0;x<OBJECT_COLS;x++){
					if(getCrashInfo(itemInfo[variety][number][y][x])!=0){
						initInfoI[0][variety][number].crashStartY=y;
						initInfoI[0][variety][number].crashStartX=x;
						flag=TRUE;
						break;
					}
				}
				if(flag==TRUE)
					break;
			}
			/* crashEndY,Xの探索 */
			for(y=OBJECT_LINES-1,flag=FALSE;y>=0;y--){
				for(x=OBJECT_COLS-1;x>=0;x--){
					if(getCrashInfo(itemInfo[variety][number][y][x])!=0){
						initInfoI[0][variety][number].crashEndY=y;
						initInfoI[0][variety][number].crashEndX=x;
						flag=TRUE;
						break;
					}
				}
				if(flag==TRUE)
					break;
			}
		}
		/* 左向きの設定 */
		for(number=0;number<ITEM_NUMBER;number++){
			initInfoI[1][variety][number].existStartY=
			initInfoI[1][variety][number].existStartX=
			initInfoI[1][variety][number].existEndY=
			initInfoI[1][variety][number].existEndX=
			initInfoI[1][variety][number].crashStartY=
			initInfoI[1][variety][number].crashStartX=
			initInfoI[1][variety][number].crashEndY=
			initInfoI[1][variety][number].crashEndX=0;
			/* existStartY,Xの探索 */
			for(y=0,flag=FALSE;y<OBJECT_LINES;y++){
				for(x=0;x<OBJECT_COLS;x++){
					if(getColorInfo(itemInfo[variety][number][y][OBJECT_COLS-x-1])<64){
						initInfoI[1][variety][number].existStartY=y;
						initInfoI[1][variety][number].existStartX=x;
						flag=TRUE;
						break;
					}
				}
				if(flag==TRUE)
					break;
			}
			/* existEndY,Xの探索 */
			for(y=OBJECT_LINES-1,flag=FALSE;y>=0;y--){
				for(x=OBJECT_COLS-1;x>=0;x--){
					if(getColorInfo(itemInfo[variety][number][y][OBJECT_COLS-x-1])<64){
						initInfoI[1][variety][number].existEndY=y;
						initInfoI[1][variety][number].existEndX=x;
						flag=TRUE;
						break;
					}
				}
				if(flag==TRUE)
					break;
			}
			/* crashStartY,Xの探索 */
			for(y=0,flag=FALSE;y<OBJECT_LINES;y++){
				for(x=0;x<OBJECT_COLS;x++){
					if(getCrashInfo(itemInfo[variety][number][y][OBJECT_COLS-x-1])!=0){
						initInfoI[1][variety][number].crashStartY=y;
						initInfoI[1][variety][number].crashStartX=x;
						flag=TRUE;
						break;
					}
				}
				if(flag==TRUE)
					break;
			}
			/* crashEndY,Xの探索 */
			for(y=OBJECT_LINES-1,flag=FALSE;y>=0;y--){
				for(x=OBJECT_COLS-1;x>=0;x--){
					if(getCrashInfo(itemInfo[variety][number][y][OBJECT_COLS-x-1])!=0){
						initInfoI[1][variety][number].crashEndY=y;
						initInfoI[1][variety][number].crashEndX=x;
						flag=TRUE;
						break;
					}
				}
				if(flag==TRUE)
					break;
			}
		}
	}
}
void initItemPara(OD* od,int var,int ste,int dir){
	createItem(od,var,getItemMoveNumber(od,var,ste),dir);
	od->state.label=ITEM;
	od->state.existFlag=TRUE;
	od->state.deathFlag=FALSE;
	od->state.maxStamina=
	od->state.stamina=0;
	od->state.charge=0;
	od->state.wallHeadFlag=
	od->state.wallFootFlag=
	od->state.wallKickFlag=FALSE;
	od->state.fallTime=0;
	od->state.fallFlag=FALSE;
	od->state.jumpCount=0;
	od->state.v0=0;
	od->state.vA=0;
	od->state.vX=0;
	od->state.motionCount=0;
	od->state.walkCount=0;
	od->now.motion=
	od->accept.motion=NO_ACTION;
	switch(var){
		case EMPTY:
			/* EMPTYのみ特例 */
			od->state.existFlag=FALSE;
			od->state.deathFlag=TRUE;
			od->state.eventFlag=FALSE;
			od->state.maxHP=
			od->state.HP=0;
			od->state.maxCharge=0;
			od->state.ATK=0;
			od->state.DEF=0;
			od->state.maxJumpCount=0;
			od->state.i0=-1.0;
			od->state.iA=-1.0;
			od->state.iX=1.0;
			break;
		case BROCK:
			od->state.eventFlag=FALSE;
			od->state.maxHP=
			od->state.HP=500;
			od->state.maxCharge=0;
			od->state.ATK=0;
			od->state.DEF=190;
			od->state.maxJumpCount=0;
			od->state.i0=-1.0;
			od->state.iA=-1.0;
			od->state.iX=1.0;
			break;
		case WISPBALL:
			od->state.eventFlag=FALSE;
			od->state.maxHP=
			od->state.HP=1;
			od->state.maxCharge=0;
			od->state.ATK=85;
			od->state.DEF=0;
			od->state.maxJumpCount=0;
			od->state.i0=-1.0;
			od->state.iA=-1.0;
			od->state.iX=1.0;
			break;
		case PLAYEREFFECT:
		case MIRROREFFECT:
		case THUNDER:
		case FIRE:
		case ATK_UP:
		case DEF_UP:
		case HP_REC:
		case SHOCK:
		case START:
		case GOAL:
		case MOVED_WALL:
		case CLEAR_WALL:
			od->state.eventFlag=FALSE;
			od->state.maxHP=
			od->state.HP=1;
			od->state.maxCharge=0;
			od->state.ATK=0;
			od->state.DEF=0;
			od->state.maxJumpCount=0;
			od->state.i0=-1.0;
			od->state.iA=-1.0;
			od->state.iX=1.0;
			break;
		case BROKEN_WALL:
			od->state.eventFlag=FALSE;
			od->state.maxHP=
			od->state.HP=10000;
			od->state.maxCharge=0;
			od->state.ATK=0;
			od->state.DEF=190;
			od->state.maxJumpCount=0;
			od->state.i0=-1.0;
			od->state.iA=-1.0;
			od->state.iX=1.0;
			break;
		case SWITCH:
			od->state.eventFlag=FALSE;
			od->state.maxHP=
			od->state.HP=10000;
			od->state.maxCharge=0;
			od->state.ATK=0;
			od->state.DEF=90;
			od->state.maxJumpCount=0;
			od->state.i0=-1.0;
			od->state.iA=-1.0;
			od->state.iX=1.0;
			break;
	}
}
void createItem(OD* od,int var,int num,int dir){
	int y,x;
	if(od->now.variety==EMPTY||od->accept.variety!=var||od->accept.number!=num||od->accept.direction!=dir){
		for(y=0;y<OBJECT_LINES;y++){
			for(x=0;x<OBJECT_COLS;x++){
				if(dir>0)
					od->state.look[y][x]=itemInfo[var][num][y][x];
				else if(dir<0)
					od->state.look[y][x]=itemInfo[var][num][y][OBJECT_COLS-x-1];
			}
		}
		od->now.variety=var;
		od->now.number=num;
		od->now.direction=dir;
		od->now.existStartY=initInfoI[(dir>0)?0:1][var][num].existStartY;
		od->now.existStartX=initInfoI[(dir>0)?0:1][var][num].existStartX;
		od->now.existEndY=initInfoI[(dir>0)?0:1][var][num].existEndY;
		od->now.existEndX=initInfoI[(dir>0)?0:1][var][num].existEndX;
		od->now.crashStartY=initInfoI[(dir>0)?0:1][var][num].crashStartY;
		od->now.crashStartX=initInfoI[(dir>0)?0:1][var][num].crashStartX;
		od->now.crashEndY=initInfoI[(dir>0)?0:1][var][num].crashEndY;
		od->now.crashEndX=initInfoI[(dir>0)?0:1][var][num].crashEndX;
	}
}
int getItemMoveNumber(OD* od,int var,int ste){
	switch(var){
		case EMPTY:
			return 0;
		case BROCK:
		case WISPBALL:
		case PLAYEREFFECT:
		case MIRROREFFECT:
		case THUNDER:
		case FIRE:
		case HP_REC:
		case SHOCK:
		case START:
		case GOAL:
		case BROKEN_WALL:
		case MOVED_WALL:
		case CLEAR_WALL:
			switch(ste){
				case NO_ACTION:
					return 0;
			}
			break;
		case ATK_UP:
		case DEF_UP:
			switch(ste){
				case NO_ACTION:
					return 0;
				case WALK:
					return 1;
			}
			break;
		case SWITCH:
			switch(ste){
				case NO_ACTION:
					return 0;
				case WALK:
					return 2;
			}
			break;
	}
}
void motionItem(OD* mine,SD* sd,CD* pd,CD* ed,OD* id){
	switch(mine->now.variety){
		case EMPTY:
			break;
		case BROCK:
			switch(mine->now.motion){
				case NO_ACTION:
					if(mine->state.HP<=mine->state.maxHP/2)
						createItem(mine,mine->now.variety,getItemMoveNumber(mine,mine->now.variety,mine->now.motion)+1,mine->now.direction);
					if(mine->state.eventFlag==FALSE){
						mine->state.fallFlag=FALSE;
						if(mine->state.wallHeadFlag==TRUE){
							mine->state.eventFlag=TRUE;
							mine->state.fallFlag=TRUE;
							mine->state.fallTime=0;
						}
					}
					break;
			}
			break;
		case WISPBALL:
			/* 空中浮遊 */
			mine->state.fallFlag=FALSE;
			switch(mine->now.motion){
				case NO_ACTION:
					if(mine->state.motionCount>=40){
						initItemPara(mine,EMPTY,NO_ACTION,RIGHT);
						break;
					}
					if(mine->state.motionCount==1){
						if(mine->state.iX<0)
							createItem(mine,mine->now.variety,getItemMoveNumber(mine,mine->now.variety,mine->now.motion),LEFT);
						else
							createItem(mine,mine->now.variety,getItemMoveNumber(mine,mine->now.variety,mine->now.motion),RIGHT);
					}
					mine->state.damage=mine->state.ATK;
					mine->now.x+=mine->state.iX;
					mine->now.y+=mine->state.iY;
					mine->state.motionCount++;
					break;
			}
			break;
		case PLAYEREFFECT:
		case MIRROREFFECT:
			/* 空中浮遊 */
			mine->state.fallFlag=FALSE;
			switch(mine->now.motion){
				case NO_ACTION:
					if(mine->state.motionCount>=30){
						initItemPara(mine,EMPTY,NO_ACTION,RIGHT);
						break;
					}
					mine->state.damage=mine->state.ATK;
					mine->now.x+=mine->state.iX;
					mine->now.y+=0;
					mine->state.motionCount++;
					break;
			}
			break;
		case THUNDER:
		case FIRE:
			/* 空中浮遊 */
			mine->state.fallFlag=FALSE;
			switch(mine->now.motion){
				case NO_ACTION:
					if(mine->state.motionCount>=18){
						initItemPara(mine,EMPTY,NO_ACTION,RIGHT);
						break;
					}
					mine->state.damage=mine->state.ATK;
					if(mine->state.motionCount%9>=0&&mine->state.motionCount%9<3){
						if(mine->state.motionCount%9==0)
							createItem(mine,mine->now.variety,getItemMoveNumber(mine,mine->now.variety,mine->now.motion)+1,mine->now.direction);
					}
					else if(mine->state.motionCount%9>=3&&mine->state.motionCount%9<6){
						if(mine->state.motionCount%9==3)
							createItem(mine,mine->now.variety,getItemMoveNumber(mine,mine->now.variety,mine->now.motion)+2,mine->now.direction);
					}
					else if(mine->state.motionCount%9>=6&&mine->state.motionCount%9<9){
						if(mine->state.motionCount%9==6)
							createItem(mine,mine->now.variety,getItemMoveNumber(mine,mine->now.variety,mine->now.motion),mine->now.direction);
					}
					mine->state.motionCount++;
					break;
			}
			break;
		case ATK_UP:
			switch(mine->now.motion){
				case NO_ACTION:
					if(
						(mine->now.wallUpLine==mine->now.y+mine->now.crashStartY-1&&getCrashInfo(sd->look[mine->now.wallUpLine][mine->now.x+mine->now.wallUpBaseX].stage)&&sd->look[mine->now.wallUpLine][mine->now.x+mine->now.wallUpBaseX].label==PLAYER)||
						(mine->now.wallDownLine==mine->now.y+mine->now.crashEndY+1&&getCrashInfo(sd->look[mine->now.wallDownLine][mine->now.x+mine->now.wallDownBaseX].stage)&&sd->look[mine->now.wallDownLine][mine->now.x+mine->now.wallDownBaseX].label==PLAYER)||
						(mine->now.wallLeftLine==mine->now.x+mine->now.crashStartX-1&&getCrashInfo(sd->look[mine->now.y+mine->now.wallLeftBaseY][mine->now.wallLeftLine].stage)&&sd->look[mine->now.y+mine->now.wallLeftBaseY][mine->now.wallLeftLine].label==PLAYER)||
						(mine->now.wallRightLine==mine->now.x+mine->now.crashEndX+1&&getCrashInfo(sd->look[mine->now.y+mine->now.wallRightBaseY][mine->now.wallRightLine].stage)&&sd->look[mine->now.y+mine->now.wallRightBaseY][mine->now.wallRightLine].label==PLAYER)
					){
						pd->mine.state.ATK+=5;
						pd->mine.state.ATKUpper+=5;
						mine->now.motion=WALK;
					}
					break;
				case WALK:
					mine->state.fallFlag=FALSE;
					if(mine->state.motionCount==0){
						mine->now.y+=mine->now.crashStartY;
						mine->now.x+=mine->now.crashStartX;
						createItem(mine,mine->now.variety,getItemMoveNumber(mine,mine->now.variety,mine->now.motion),RIGHT);
					}
					else if(mine->state.motionCount>0&&mine->state.motionCount<20){
						if(mine->state.motionCount%2==1)
							mine->now.y--;
					}
					else if(mine->state.motionCount>=20)
						initItemPara(mine,EMPTY,NO_ACTION,RIGHT);
					mine->state.motionCount++;
					break;
			}
			break;
		case DEF_UP:
			switch(mine->now.motion){
				case NO_ACTION:
					if(
						(mine->now.wallUpLine==mine->now.y+mine->now.crashStartY-1&&getCrashInfo(sd->look[mine->now.wallUpLine][mine->now.x+mine->now.wallUpBaseX].stage)&&sd->look[mine->now.wallUpLine][mine->now.x+mine->now.wallUpBaseX].label==PLAYER)||
						(mine->now.wallDownLine==mine->now.y+mine->now.crashEndY+1&&getCrashInfo(sd->look[mine->now.wallDownLine][mine->now.x+mine->now.wallDownBaseX].stage)&&sd->look[mine->now.wallDownLine][mine->now.x+mine->now.wallDownBaseX].label==PLAYER)||
						(mine->now.wallLeftLine==mine->now.x+mine->now.crashStartX-1&&getCrashInfo(sd->look[mine->now.y+mine->now.wallLeftBaseY][mine->now.wallLeftLine].stage)&&sd->look[mine->now.y+mine->now.wallLeftBaseY][mine->now.wallLeftLine].label==PLAYER)||
						(mine->now.wallRightLine==mine->now.x+mine->now.crashEndX+1&&getCrashInfo(sd->look[mine->now.y+mine->now.wallRightBaseY][mine->now.wallRightLine].stage)&&sd->look[mine->now.y+mine->now.wallRightBaseY][mine->now.wallRightLine].label==PLAYER)
					){
						pd->mine.state.DEF+=5;
						pd->mine.state.DEFUpper+=5;
						mine->now.motion=WALK;
					}
					break;
				case WALK:
					mine->state.fallFlag=FALSE;
					if(mine->state.motionCount==0){
						mine->now.y+=mine->now.crashStartY;
						mine->now.x+=mine->now.crashStartX;
						createItem(mine,mine->now.variety,getItemMoveNumber(mine,mine->now.variety,mine->now.motion),RIGHT);
					}
					else if(mine->state.motionCount>0&&mine->state.motionCount<20){
						if(mine->state.motionCount%2==1)
							mine->now.y--;
					}
					else if(mine->state.motionCount>=20)
						initItemPara(mine,EMPTY,NO_ACTION,RIGHT);
					mine->state.motionCount++;
					break;
			}
			break;
		case HP_REC:
			switch(mine->now.motion){
				case NO_ACTION:
					if(
						(mine->now.wallUpLine==mine->now.y+mine->now.crashStartY-1&&getCrashInfo(sd->look[mine->now.wallUpLine][mine->now.x+mine->now.wallUpBaseX].stage)&&sd->look[mine->now.wallUpLine][mine->now.x+mine->now.wallUpBaseX].label==PLAYER)||
						(mine->now.wallDownLine==mine->now.y+mine->now.crashEndY+1&&getCrashInfo(sd->look[mine->now.wallDownLine][mine->now.x+mine->now.wallDownBaseX].stage)&&sd->look[mine->now.wallDownLine][mine->now.x+mine->now.wallDownBaseX].label==PLAYER)||
						(mine->now.wallLeftLine==mine->now.x+mine->now.crashStartX-1&&getCrashInfo(sd->look[mine->now.y+mine->now.wallLeftBaseY][mine->now.wallLeftLine].stage)&&sd->look[mine->now.y+mine->now.wallLeftBaseY][mine->now.wallLeftLine].label==PLAYER)||
						(mine->now.wallRightLine==mine->now.x+mine->now.crashEndX+1&&getCrashInfo(sd->look[mine->now.y+mine->now.wallRightBaseY][mine->now.wallRightLine].stage)&&sd->look[mine->now.y+mine->now.wallRightBaseY][mine->now.wallRightLine].label==PLAYER)
					){
						pd->mine.state.HP=pd->mine.state.maxHP;
						initItemPara(mine,EMPTY,NO_ACTION,RIGHT);
					}
					break;
			}
			break;
		case SHOCK:
			switch(mine->now.motion){
				case NO_ACTION:
					if(
						(mine->now.wallUpLine==mine->now.y+mine->now.crashStartY-1&&getCrashInfo(sd->look[mine->now.wallUpLine][mine->now.x+mine->now.wallUpBaseX].stage)&&sd->look[mine->now.wallUpLine][mine->now.x+mine->now.wallUpBaseX].label==PLAYER)||
						(mine->now.wallDownLine==mine->now.y+mine->now.crashEndY+1&&getCrashInfo(sd->look[mine->now.wallDownLine][mine->now.x+mine->now.wallDownBaseX].stage)&&sd->look[mine->now.wallDownLine][mine->now.x+mine->now.wallDownBaseX].label==PLAYER)||
						(mine->now.wallLeftLine==mine->now.x+mine->now.crashStartX-1&&getCrashInfo(sd->look[mine->now.y+mine->now.wallLeftBaseY][mine->now.wallLeftLine].stage)&&sd->look[mine->now.y+mine->now.wallLeftBaseY][mine->now.wallLeftLine].label==PLAYER)||
						(mine->now.wallRightLine==mine->now.x+mine->now.crashEndX+1&&getCrashInfo(sd->look[mine->now.y+mine->now.wallRightBaseY][mine->now.wallRightLine].stage)&&sd->look[mine->now.y+mine->now.wallRightBaseY][mine->now.wallRightLine].label==PLAYER)
					){
						int i,j;
						for(i=0;i<MAX_ENEMY;i++){
							if(
								(ed[i].mine.state.existFlag==TRUE)&&
								(getSqrtDistant(ed[i].mine.now.y,ed[i].mine.now.x,pd->mine.now.y,pd->mine.now.x)<=getSqrtDistant(0,0,100,100))
							){
								for(j=0;j<MAX_HAVE;j++){
									if(ed[i].have[j].state.existFlag==FALSE){
										initItemPara(&ed[i].have[j],THUNDER,NO_ACTION,RIGHT);
										ed[i].have[j].now.y=ed[i].have[j].accept.y=ed[i].mine.now.y+ed[i].mine.now.crashEndY-OBJECT_LINES+1;
										ed[i].have[j].now.x=ed[i].have[j].accept.x=ed[i].mine.now.x;
										ed[i].have[j].state.label=PLAYER;
										ed[i].have[j].state.ATK=pd->mine.state.ATK*1.4;
										break;
									}
								}
							}
						}
						initItemPara(mine,EMPTY,NO_ACTION,RIGHT);
					}
					break;
			}
			break;
		case START:
		case GOAL:
			switch(mine->now.motion){
				case NO_ACTION:
					if(mine->state.eventFlag==TRUE)
						initItemPara(mine,EMPTY,NO_ACTION,RIGHT);
					else{
						if(pd->mine.now.y+pd->mine.now.crashEndY+1==mine->now.y+mine->now.crashStartY&&pd->mine.now.x+pd->mine.now.crashStartX<=mine->now.x+mine->now.crashStartX&&pd->mine.now.x+pd->mine.now.crashEndX>=mine->now.x+mine->now.crashEndX)
							mine->state.eventFlag=TRUE;
					}
					break;
			}
			break;
		case BROKEN_WALL:
			switch(mine->now.motion){
				case NO_ACTION:
					if(mine->state.eventFlag==FALSE){
						mine->state.fallFlag=FALSE;
						if(mine->state.HP<mine->state.maxHP){
							mine->state.eventFlag=TRUE;
							mine->state.fallFlag=TRUE;
							mine->state.fallTime=0;
						}
					}
					else{
						if(mine->state.fallFlag==TRUE)
							createItem(mine,mine->now.variety,getItemMoveNumber(mine,mine->now.variety,mine->now.motion)+1,mine->now.direction);
						else{
							if(mine->state.motionCount>=0&&mine->state.motionCount<4){
								if(mine->state.motionCount==0)
									createItem(mine,mine->now.variety,getItemMoveNumber(mine,mine->now.variety,mine->now.motion)+2,mine->now.direction);
							}
							else if(mine->state.motionCount>=4&&mine->state.motionCount<8){
								if(mine->state.motionCount==4)
									createItem(mine,mine->now.variety,getItemMoveNumber(mine,mine->now.variety,mine->now.motion)+3,mine->now.direction);
							}
							else if(mine->state.motionCount>=8&&mine->state.motionCount<12){
								if(mine->state.motionCount==8)
									createItem(mine,mine->now.variety,getItemMoveNumber(mine,mine->now.variety,mine->now.motion)+4,mine->now.direction);
							}
							if(mine->state.motionCount<12)
								mine->state.motionCount++;
						}
					}
					break;
			}
			break;
		case MOVED_WALL:
			mine->state.fallFlag=FALSE;
			break;
		case CLEAR_WALL:
			switch(mine->now.motion){
				case NO_ACTION:
					if(ed[0].mine.state.existFlag==FALSE)
						initItemPara(mine,EMPTY,NO_ACTION,RIGHT);
					break;
			}
			break;
		case SWITCH:
			switch(mine->now.motion){
				case NO_ACTION:
					if(mine->state.eventFlag==FALSE){
						if(mine->state.HP<mine->state.maxHP){
							mine->state.eventFlag=TRUE;
							mine->state.motionCount=0;
						}
					}
					else{
						mine->state.HP=mine->state.maxHP;
						if(mine->state.motionCount>=0&&mine->state.motionCount<4){
							if(mine->state.motionCount==0)
								createItem(mine,mine->now.variety,getItemMoveNumber(mine,mine->now.variety,NO_ACTION)+1,mine->now.direction);
						}
						else if(mine->state.motionCount>=4&&mine->state.motionCount<8){
							if(mine->state.motionCount==4)
								createItem(mine,mine->now.variety,getItemMoveNumber(mine,mine->now.variety,NO_ACTION)+2,mine->now.direction);
						}
						if(mine->state.motionCount<8)
							mine->state.motionCount++;
						else{
							mine->now.motion=WALK;
							sd->stageColor=7;
							mine->state.motionCount=0;
							bkgd(COLOR_PAIR(sd->stageColor));
						}
					}
					break;
				case WALK:
					if(mine->state.eventFlag==FALSE){
						if(mine->state.motionCount>=0&&mine->state.motionCount<4){
							if(mine->state.motionCount==0)
								createItem(mine,mine->now.variety,getItemMoveNumber(mine,mine->now.variety,NO_ACTION)+3,mine->now.direction);
						}
						else if(mine->state.motionCount>=4&&mine->state.motionCount<8){
							if(mine->state.motionCount==4)
								createItem(mine,mine->now.variety,getItemMoveNumber(mine,mine->now.variety,NO_ACTION),mine->now.direction);
						}
						if(mine->state.motionCount<8)
							mine->state.motionCount++;
						else{
							mine->now.motion=NO_ACTION;
							sd->stageColor=8;
							mine->state.motionCount=0;
							bkgd(COLOR_PAIR(sd->stageColor));
						}
					}
					break;
			}
			break;
	}
}

